function showptable(){
	numlist=Object.keys(totallist);
	tablebody=document.getElementById('reporttable').children[1];
	ggg=0;
	for (tbr=0;tbr<numlist.length;tbr++){
		if (numlist[tbr].length==13){
			ggg+=1;
			row = tablebody.insertRow();
			row.onclick = function() {
				var selected = document.querySelector(".highlight");
				if (selected) selected.classList.remove("highlight");
				this.classList.add("highlight");
			};
			for (tbc=0;tbc<=76;tbc++){
				cell = row.insertCell();
				if (totallist[numlist[tbr]][tbc]==null){
					cell.textContent="";
				} else {
					cell.textContent=totallist[numlist[tbr]][tbc];
				}			
			}
		}
	}
	document.getElementById('endnum').value=ggg;
}
function readexcelall(){
	return new Promise((resolve, reject) => {
		excelall = document.getElementById('excelall');
		if (!excelall.files.length) {
			resolve(false);
		} else {
			const reader = new FileReader();
			reader.onload = function(e) {
				totallist={};
				const data = new Uint8Array(e.target.result);
				const workbook = XLSX.read(data, {type: 'array'});
				const firstSheetName = workbook.SheetNames[0];
				const worksheet = workbook.Sheets[firstSheetName];
				const range = XLSX.utils.decode_range(worksheet['!ref']);
				for (let R = 1; R <= range.e.r; R++) {
					thenum=getxlsvalue(worksheet[XLSX.utils.encode_cell({c: 0, r: R})]);
					if (!totallist[thenum]) {
                        totallist[thenum] = {};
                    }
					for (C=0;C<=76;C++){
						totallist[thenum][C.toString()]=getxlsvalue(worksheet[XLSX.utils.encode_cell({c: C, r: R})]);
					}
				}
				resolve(true);
			};
			reader.onerror = function() {
                reject(new Error('讀取錯誤'));
            };
			 reader.readAsArrayBuffer(excelall.files[0]);
		}
	 });
}
async function starttransferall(){
	try {
		tablebody=document.getElementById('reporttable').children[1];
		tablebody.innerHTML='';
		errmsg='';
        result= await readexcelall();
        if (!result) {
            errmsg=errmsg+'總表錯誤\n'
        } 
		showptable();
    } catch (error) {
        alert(`${error.message}`); 
    }
}
function exportrisk(){
    const table = document.getElementById("reporttable");
    const rows = Array.from(table.rows);

    let data = [
	["ID","性別","年齡","身高(公分)","體重(公斤)","腰圍(公分)","收縮壓(mm/Hg)","總膽固醇(mg/dl)","高密度膽固醇(mg/dl)","低密度膽固醇(mg/dl)","三酸甘油脂(mg/dl)","空腹血糖(mg/dl)","是否有糖尿病","是否有高血壓","吸菸習慣","冠心病","","","高血壓","","","心血管不良事件","","","糖尿病","","","腦中風","",""],
	["","","","","","","","","","","","","","","","族群(%)","個人(%)","風險值","族群(%)","個人(%)","風險值","族群(%)","個人(%)","風險值","族群(%)","個人(%)","風險值","族群(%)","個人(%)","風險值"]
	];
	
    for (let i=1;i<rows.length;i++){
		let cells=rows[i].cells;
		let templine=[];
		templine.push(cells[0].textContent);
		if (cells[5].textContent=="男"){
			templine.push("M");
		} else {
			templine.push("F");
		}
		templine.push(cells[4].textContent);
		templine.push(cells[13].textContent);
		templine.push(cells[14].textContent);
		templine.push(cells[16].textContent);
		templine.push(cells[12].textContent);
		templine.push(cells[33].textContent);
		templine.push(cells[35].textContent);
		templine.push(cells[36].textContent);
		templine.push(cells[34].textContent);
		templine.push(cells[31].textContent);
		templine.push("N");
		templine.push("N");
		if (cells[22].textContent=="有"){
			templine.push("Y");
		} else {
			templine.push("N");
		}
		data.push(templine);
	}

    // 轉為 worksheet
    const worksheet = XLSX.utils.aoa_to_sheet(data);

    const range = XLSX.utils.decode_range(worksheet['!ref']);
	for (let R = range.s.r + 1; R <= range.e.r; ++R) {  // 跳過標題列
		for (let C = range.s.c; C <= range.e.c; ++C) {
			const cell_address = XLSX.utils.encode_cell({ r: R, c: C });
			const cell = worksheet[cell_address];
			if (cell) {
				const val = parseFloat(cell.v);
				if (!isNaN(val)) {
					cell.v = val;
					cell.t = 'n';  // 設定為數值格式
				}
			}
		}
	}

    // 建立 Excel 並下載
    const workbook = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(workbook, worksheet, "Sheet1");
    const wbout = XLSX.write(workbook, {
		bookType: "xls",     // SpreadsheetML (不是 binary xls)
		type: "array"
	});
    const blob = new Blob([wbout], { type: 'application/octet-stream' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "計算風險用.xls";
    a.click();
    URL.revokeObjectURL(url);
	
}
function exportToExcel() {
    const table = document.getElementById("reporttable");
    let worksheet = XLSX.utils.table_to_sheet(table, {raw: true}); 
    for (let cell in worksheet) {
        if (cell.startsWith('!')) continue; 
        worksheet[cell].t = 's'; 
    }
    const workbook = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(workbook, worksheet, "Sheet1");
    const wbout = XLSX.write(workbook, {bookType: 'xlsx', type: 'array'});
    const blob = new Blob([wbout], {type: 'application/octet-stream'});
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "總表匯出.xlsx";
    a.click();
    URL.revokeObjectURL(url);
}
function granfromtable(){
	tablebody=document.getElementById('reporttable').children[1];
	grabobj={};
	for (i=0;i<tablebody.rows.length;i++){
		thenum=tablebody.rows[i].cells[0].textContent;
		grabobj[thenum]={};
		for (j=0;j<=76;j++){
			grabobj[thenum][j.toString()]=tablebody.rows[i].cells[j].textContent;
		}
	}
	return grabobj
}
