function addcomment(value,upper,lower,checkNAN){
	retvalue=value;
	if (upper!=0){
		if (value*1>upper){
			retvalue=value+"↑";
		}
	}
	if (lower!=0){
		if (value*1<lower){
			retvalue=value+"↓";
		}
	}
	if (checkNAN){
		if (isNaN(value*1)){
			retvalue=value+"*";
		}
	}
	return retvalue
}
