	opdam3=opdam3.replaceAll("\n","<br>");
	opdam4=opdam4.replaceAll("\n","<br>");
	opdam5=opdam5.replaceAll("\n","<br>");
	opdpm1=opdpm1.replaceAll("\n","<br>");
	opdpm2=opdpm2.replaceAll("\n","<br>");
	opdpm3=opdpm3.replaceAll("\n","<br>");
